import React, { useEffect, useState } from "react";
import {
  Form,
  FormGroup,
  FormLabel,
  FormControl,
  Button,
} from "react-bootstrap";
import axios from "axios";
import Select from "react-dropdown-select";
import "../assests/App.css";
const Menu = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    const options = []
    axios
      .get("http://127.0.0.1:5000/parcel")
      .then((response) => {
        setData(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);
  return (
    <div className="menu">
      <div className="container">
        <h1>Select the Farm</h1>
        <Form>
          <Select className="select" placeholder="State">
            {data.map(parcel =>
            <option key = {parcel.KGISStateID} value = {parcel.KGISStateID}>
              {parcel.KGISStateName}
            </option>
            )}
          </Select>
          {/*
          <Select className="select" options={options} placeholder="District" />

          <Select className="select" options={options} placeholder="Hobli" />

          <Select className="select" options={options} placeholder="Village" />
            */}
          <FormControl
            className="surveyno"
            type="number"
            placeholder="Survey no"
          />

          <Button type="Submit">Submit</Button>
        </Form>
        <div className="bbox">
          <h4>API:</h4>
        </div>
      </div>
    </div>
  );
};

export default Menu;
